$(document).ready(function(){

$('#formulario').submit(function(e){ //Función para la creación de tareas.
        const postData = {
            name: $('#name').val(),
            raza: $('#raza').val(),
            edad: $('#edad').val(),
            estado: $('#estado').val(),
            texto: $('#texto').val(),
            antirrabica: $('#antirrabica').val(),
            pentavalente: $('#pentavalente').val(),
            externa: $('#externa').val(),
            interna: $('#interna').val(),
            chip: $('#chip').val(),
            color: $('#color').val(),
            castrado: $('#castrado').val(),
            entrada: $('#entrada').val(),
            salida: $('#salida').val()
        };
        var imgData = 'data:image/jpeg;base64,';

        var doc = new jsPDF();
        doc.setFontSize(25);
        doc.text(20, 20, 'ASOCIACIÓN AGALLAS');
        doc.addImage(imgData, 'JPEG', 140, 20, 50, 50);
        doc.setFontSize(20);
        doc.text(20, 40, 'Ficha de datos de animal.');
        doc.setFontSize(15);
        doc.text(20, 60, 'Nombre del perro:');
        doc.setTextColor(100);
        doc.text(20, 70, postData.name);
        doc.setTextColor(0,0,0);
        doc.text(20, 80, 'Raza: ');
        doc.setTextColor(100);
        doc.text(20, 90, postData.raza);
        doc.setTextColor(0,0,0);
        doc.text(90, 80, 'Color: ');
        doc.setTextColor(100);
        doc.text(90, 90, postData.color);
        doc.setTextColor(0,0,0);
        doc.text(20, 100, 'Año de nacimiento: ');
        doc.setTextColor(100);
        doc.text(20, 110, postData.edad);
        doc.setTextColor(0,0,0);
        doc.text(120, 100, 'Número de chip: ');
        doc.setTextColor(100);
        doc.text(120, 110, postData.chip);
        doc.setTextColor(0,0,0);
        doc.text(20, 120, 'Situación actual: ');
        doc.setTextColor(100);
        doc.text(20, 130, postData.estado);
        doc.setTextColor(0,0,0); 
        doc.text(120, 120, 'Esterilizado: ');
        doc.setTextColor(100);
        doc.text(120, 130, postData.castrado);
        doc.setTextColor(0,0,0);
        doc.text(20, 150, 'Fecha última pentavalente:');
        doc.setTextColor(100);
        doc.text(20, 160, postData.pentavalente);
        doc.setTextColor(0,0,0);
        doc.text(120, 150, 'Fecha última antirrábica:');
        doc.setTextColor(100);
        doc.text(120, 160, postData.antirrabica);
        doc.setTextColor(0,0,0);
        doc.text(20, 180, 'Fecha desparasitación externa:');
        doc.setTextColor(100);
        doc.text(20, 190, postData.externa);
        doc.setTextColor(0,0,0);
        doc.text(120, 180, 'Fecha desparasitación Interna:');
        doc.setTextColor(100);
        doc.text(120, 190, postData.interna);
        doc.setTextColor(0,0,0);
        doc.text(20, 210, 'Fecha entrada perrera:');
        doc.setTextColor(100);
        doc.text(20, 220, postData.entrada);
        doc.setTextColor(0,0,0);
        doc.text(120, 210, 'Fecha salida perrera:');
        doc.setTextColor(100);
        doc.text(120, 220, postData.salida);
        doc.setTextColor(0,0,0);
        
        
        doc.text(20, 230, 'Información:');
        doc.setTextColor(100);
        doc.text(20, 240, postData.texto);
        doc.save(postData.name +'.pdf'); 
        
        e.preventDefault();
    });
    
}); // Fin js